import React from 'react';
import { Link }  from 'react-router-dom';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const Track = (props) => {
    const { track } = props;

    return (
        <div className="col-md-6">
            <div className="card mb-4 shadow-sm">
                <div className ="card-body">
                    <p className="card-text">

                    <FontAwesomeIcon icon="coffee"/>
                    <strong>Track</strong>: {track}</p> 
                        <p> <strong>Artist:</strong>  <h6>{props.artist}</h6>

                    </p>

                    <img src={props.cover} width='150'></img>
                    <p></p>
                    <p><strong>Album:</strong> {props.album}</p>
                   <Link to={`lyrics/track/${props.id_track}`}
                   className="btn btn-dark btn-block"> View Lyrics</Link>
                </div>
            </div>

        </div>
    )
}
export default Track;
